syntax = "proto3";

message HeadImgs {
    string img_url = 1;
    string pc_url = 2;
    string title = 3;
    string subtitle = 4;
    string btn_text = 5;
    string tag_name_url = 6;
    string tag_name_wh = 7;
    string schema = 8;
    repeated string third_statistics_url = 9;
    uint32 has_second_page = 10;
    string package_name = 11;
}
